[Form]
public class InventTransOnOrder extends FormRun
{
    InventDimCtrl_Frm       inventDimFormSetup;
    InventDimParm           inventDimParm;
    InventDimParm           inventDimParmAll;

    InventTransSum          inventTransSum;

}

public void init()
{
    inventTransSum = InventTransSum::newChildTypeInventDim();
    inventDimParmAll.setAllInventDim();

    super();

    InventTransFormHelper::formQueryAddDefaultOriginLink(inventTransOrigin_DS, inventTrans_DS);
}

public InventDimCtrl_Frm inventDimSetupObject()
{
    if (!inventDimFormSetup)
    {
        inventDimFormSetup  = InventDimCtrl::newFromForm(element);
    }

    return inventDimFormSetup;
}

public void updateDesign(InventDimFormDesignUpdate _mode)
{
    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = element.inventDimSetupObject();
            }

            inventDimFormSetup.parmDimParmEnabled(null);
            inventDimFormSetup.parmDimParmVisibleGrid(inventDimParm);
            inventDimFormSetup.formSetControls(true,true);
            break;

        default :
            throw error(strFmt("@SYS54195",funcName()));
    }
}

public void init()
{
    QueryBuildDataSource    qbdsInventTransOrigin;
    QueryBuildDataSource    qbdsInventTrans;

    super();

    qbdsInventTransOrigin = this.query().dataSourceTable(tableNum(InventTransOrigin));
    qbdsInventTrans       = this.query().dataSourceTable(tableNum(InventTrans));

    qbdsInventTrans.      addGroupByField(fieldNum(InventTrans,      DateExpected));
    qbdsInventTransOrigin.addGroupByField(fieldNum(InventTransOrigin,ReferenceCategory));
    qbdsInventTransOrigin.addGroupByField(fieldNum(InventTransOrigin,ReferenceId));
    qbdsInventTrans.      addGroupByField(fieldNum(InventTrans,      TransChildType));
    qbdsInventTrans.      addGroupByField(fieldNum(InventTrans,      TransChildRefId));
    qbdsInventTransOrigin.addGroupByField(fieldNum(InventTransOrigin,ItemId));
    qbdsInventTransOrigin.addGroupByField(fieldNum(InventTransOrigin,Party));
    qbdsInventTrans.      addGroupByField(fieldNum(InventTrans,      TableId));
    qbdsInventTransOrigin.addGroupByField(fieldNum(InventTransOrigin,RecId));             // Used reservation button
    qbdsInventTrans.      addGroupByField(fieldNum(InventTrans,      InventTransOrigin)); // Used in display methods on InventTrans DS
    qbdsInventTrans.      addGroupByField(fieldNum(InventTrans,      InventDimId));       // Used in display methods on InventTrans DS

    qbdsInventTrans.addRange(fieldNum(InventTrans,StatusReceipt)).value('0');
    qbdsInventTrans.addRange(fieldNum(InventTrans,StatusIssue)).value(queryValue(StatusIssue::ReservPhysical)+','+queryValue(StatusIssue::ReservOrdered)+','+queryValue(StatusIssue::OnOrder));
}

public display InventQtyOnOrder  onOrder(InventTrans _inventTrans)
{
    return inventTransSum.originOnOrder(
        _inventTrans.InventTransOrigin,
        _inventTrans.TransChildType,
        _inventTrans.TransChildRefId,
        InventDim::find(_inventTrans.InventDimId),
        inventDimParmAll);
}

public display InventQtyReservPhysical  reservPhysical(InventTrans _inventTrans)
{
    return inventTransSum.originReservPhysical(
        _inventTrans.InventTransOrigin,
        _inventTrans.TransChildType,
        _inventTrans.TransChildRefId,
        InventDim::find(_inventTrans.InventDimId),
        inventDimParmAll);
}

public display InventQtyReservOrdered  reservOrdered(InventTrans _inventTrans)
{
    return inventTransSum.originReservOrdered(
        _inventTrans.InventTransOrigin,
        _inventTrans.TransChildType,
        _inventTrans.TransChildRefId,
        InventDim::find(_inventTrans.InventDimId),
        inventDimParmAll);
}

public int active()
{
    int ret = super();

    InventReserve.enabled(InventTransOrigin.ReferenceCategory != InventTransType::WHSWork);

    return ret;
}

public void executeQuery()
{
    Query query = new Query();
    QueryBuildDataSource qbs;

    qbs = query.addDataSource(tableNum(InventTrans));
    qbs.addRange(fieldNum(InventTrans,InventTransOrigin)).value(queryValue(inventTransOrigin.RecId));
    qbs.name(inventTransButton_ds.name());
    this.query(query);

    super();
}

public void executeQuery()
{
    QueryBuildDataSource queryBuildDataSource;

    switch (element.args().dataset())
    {
        case tableNum(InventSum):
        case tableNum(GanttTmpMaterials):
            queryBuildDataSource = inventTransOrigin_q.dataSourceTable(tableNum(InventTransOrigin));
            queryBuildDataSource.addDynalink(fieldNum(InventTransOrigin, ItemId), element.args().record(),
                            fieldName2id(element.args().dataset(),fieldStr(InventTransOrigin,ItemId)));

            InventDim::queryAddRangeFromCallerSort(this.query().dataSourceTable(tableNum(InventDim)),element.args(),true);
            inventDimParm.initFromQueryCallerGroupBy(element.args());
            element.updateDesign(InventDimFormDesignUpdate::Init);
            break;

        default:
            inventDimParm.data(inventDimParmAll);
            inventDimParm.queryAddGroupByField(this.query().dataSourceTable(tableNum(InventDim)));
            break;
    }

    super();
}
